import { Input, Select } from './blocks/Input';
import { TYPES } from './vars';

const Registration = () => {
  return (
    <section className='registration'>
      <h1>Live a request</h1>
      <form action='#'>
        <Input id='firstname' name='Name' type='text' />
        <Input id='email' name='Email' type='text' />
        <Select name='types' types={TYPES} />
        <Select name='b' types={TYPES} />
      </form>
    </section>
  );
};

export default Registration;
